import React from "react";
import "./Header.css";

export default function Header() {
  return (
    <header className="Header">
    <nav className="Nav">
    <a href="/">Home</a>
    <a href="/">About Me</a>
    <a href="/">Contact</a>
    </nav>
    </header>
  );
}
